INSERT INTO `cache_entity` VALUES ('field:node:1','a:1:{s:2:\"en\";a:1:{s:4:\"body\";a:1:{i:0;a:3:{s:5:\"value\";s:1253:\"<p>Hello! I&#39;m Ian. I&#39;ve pushed this site live a lot sooner than I expected because I&#39;m taking a trip and would like to share that with you!</p>\r\n\r\n<p>So a little about me, I&#39;m currently studying Computer Engineering at California State University, Long Beach<em>(CSULB)</em> with a minor in Computer Science. I work for the University Relations and Developement Department for my university and played a major role in one of the largest social media pushes the university has ever done. I am continuing to help innovate and bring CSULB to the next level.&nbsp;</p>\r\n\r\n<p>As well as working on campus, I also have been an active member and officer in many clubs on campus. I was webmaster and vice president of the Long Beach chapter of the Association of Computing Machinery. The project manager for the Embedded Applications Technology Assosiation. And I currently hold the position of Vice President of Technology the the Long Beach Makers Society.</p>\r\n\r\n<p>I&#39;m busy, very busy and really love what I do. My current projects are my Rep Rap Redux in which I am redesigning and building a new 3D printer using what I learning from my Prusa Mendel and other printers I have examined into a 1.5ft cubed printer. It will be HUGE.</p>\r\n\";s:7:\"summary\";s:0:\"\";s:6:\"format\";s:9:\"full_html\";}}}}',-1,1405024914.760,1,'entity_field_info:1',0,85),('field:node:10','a:1:{s:2:\"en\";a:2:{s:4:\"body\";a:1:{i:0;a:3:{s:5:\"value\";s:655:\"<p>The people of Switzerland are almost as striking as the <a href=\"http://www.iangoegebuer.com/node/9\">architecture</a>! You see some people performing(very little in fact). Most people just keep to themselves and carry on. The last picture is Julian, he&#39;s been teaching us a touch of French. He is a vary animated individual and is a lot of fun to be around. He&#39;s Scottish and Swiss. He is extremely animated and really seems to enjoy what he does.</p>\r\n\r\n<p>So the interesting thing about the Swiss is they don&#39;t make eye contact. It&#39;s hard to get used to because doing so is really weird and makes the locals uncomfortable.&nbsp;</p>\r\n\";s:7:\"summary\";s:0:\"\";s:6:\"format\";s:9:\"full_html\";}}s:13:\"field_gallery\";a:4:{i:0;a:5:{s:9:\"target_id\";s:2:\"36\";s:3:\"alt\";s:0:\"\";s:5:\"title\";s:0:\"\";s:5:\"width\";s:4:\"2592\";s:6:\"height\";s:4:\"3872\";}i:1;a:5:{s:9:\"target_id\";s:2:\"37\";s:3:\"alt\";s:0:\"\";s:5:\"title\";s:0:\"\";s:5:\"width\";s:4:\"2592\";s:6:\"height\";s:4:\"3872\";}i:2;a:5:{s:9:\"target_id\";s:2:\"38\";s:3:\"alt\";s:0:\"\";s:5:\"title\";s:0:\"\";s:5:\"width\";s:4:\"2592\";s:6:\"height\";s:4:\"3872\";}i:3;a:5:{s:9:\"target_id\";s:2:\"39\";s:3:\"alt\";s:0:\"\";s:5:\"title\";s:0:\"\";s:5:\"width\";s:4:\"2592\";s:6:\"height\";s:4:\"3872\";}}}}',-1,1405028570.107,1,'entity_field_info:1',0,85),('field:node:11','a:1:{s:2:\"en\";a:2:{s:4:\"body\";a:1:{i:0;a:3:{s:5:\"value\";s:237:\"I\'m on my phone so this shall be quick, but I\'m laying in a Hotel Hostel in Milan Italy. This city is so full of life and the people are so animated! Being here is so much fun!\r\n\r\nI\'ll write more tomorrow when I get back to Switzerland. \";s:7:\"summary\";s:0:\"\";s:6:\"format\";s:10:\"basic_html\";}}s:7:\"comment\";a:1:{i:0;a:1:{s:6:\"status\";s:1:\"2\";}}}}',-1,1405204802.117,1,'entity_field_info:1',0,85),('field:node:12','a:1:{s:2:\"en\";a:2:{s:4:\"body\";a:1:{i:0;a:3:{s:5:\"value\";s:577:\"<p>The food an coffee here is amazing! The calzone in Italy was wonderful!</p>\r\n\r\n<p>Okay, so coffee or caf&eacute; as it&#39;s really called is good. It is not coffee as we know it. It is really smooth and really small. I like it, but I really do miss American Coffee. The coffee here is good for about 5 seconds and then it&#39;s been drunk. It is actually a really good desert or post desert drink.</p>\r\n\r\n<p>Desert brings me to chocolate. The chocolate here is amazing. They have 80% cocoa. So dark! So good! There&#39;s also one with carmel crunchy bits in it.&nbsp;</p>\r\n\";s:7:\"summary\";s:0:\"\";s:6:\"format\";s:10:\"basic_html\";}}s:13:\"field_gallery\";a:4:{i:0;a:5:{s:9:\"target_id\";s:2:\"40\";s:3:\"alt\";s:0:\"\";s:5:\"title\";s:0:\"\";s:5:\"width\";s:4:\"3872\";s:6:\"height\";s:4:\"2592\";}i:1;a:5:{s:9:\"target_id\";s:2:\"46\";s:3:\"alt\";s:0:\"\";s:5:\"title\";s:0:\"\";s:5:\"width\";s:4:\"3872\";s:6:\"height\";s:4:\"2592\";}i:2;a:5:{s:9:\"target_id\";s:2:\"44\";s:3:\"alt\";s:0:\"\";s:5:\"title\";s:0:\"\";s:5:\"width\";s:4:\"3872\";s:6:\"height\";s:4:\"2592\";}i:3;a:5:{s:9:\"target_id\";s:2:\"42\";s:3:\"alt\";s:0:\"\";s:5:\"title\";s:0:\"\";s:5:\"width\";s:4:\"3872\";s:6:\"height\";s:4:\"2592\";}}}}',-1,1407192343.397,1,'entity_field_info:1',0,85),('field:node:13','a:1:{s:2:\"en\";a:2:{s:4:\"body\";a:1:{i:0;a:3:{s:5:\"value\";s:275:\"<p> Geneva is the closest thing to a city as I think of them in Switzerland. It\'s very international and very much not Swiss. The people are in a rush. The city is beautiful,as is the gyser. The food is okay. At least where we tried. The main reason for Geneva was CERN. </p>\";s:7:\"summary\";s:0:\"\";s:6:\"format\";s:10:\"basic_html\";}}s:13:\"field_gallery\";a:3:{i:0;a:5:{s:9:\"target_id\";s:2:\"52\";s:3:\"alt\";s:0:\"\";s:5:\"title\";s:0:\"\";s:5:\"width\";s:4:\"3872\";s:6:\"height\";s:4:\"2592\";}i:1;a:5:{s:9:\"target_id\";s:2:\"54\";s:3:\"alt\";s:0:\"\";s:5:\"title\";s:0:\"\";s:5:\"width\";s:4:\"3872\";s:6:\"height\";s:4:\"2592\";}i:2;a:5:{s:9:\"target_id\";s:2:\"56\";s:3:\"alt\";s:0:\"\";s:5:\"title\";s:0:\"\";s:5:\"width\";s:4:\"3872\";s:6:\"height\";s:4:\"2592\";}}}}',-1,1407194560.592,1,'entity_field_info:1',0,85),('field:node:9','a:1:{s:2:\"en\";a:2:{s:4:\"body\";a:1:{i:0;a:3:{s:5:\"value\";s:362:\"<p>As would be normal to hear from Americans, but the age of the buildings and the architecture is wonderful! I can&#39;t put into words how wonderful it is to see the architecture. I put some pictures of what the old town looks like. You can find replicas in the states, but it really doesn&#39;t compare to the real life age and beauty. See for yourself!</p>\r\n\";s:7:\"summary\";s:0:\"\";s:6:\"format\";s:9:\"full_html\";}}s:13:\"field_gallery\";a:4:{i:0;a:5:{s:9:\"target_id\";s:2:\"32\";s:3:\"alt\";s:0:\"\";s:5:\"title\";s:0:\"\";s:5:\"width\";s:4:\"3872\";s:6:\"height\";s:4:\"2592\";}i:1;a:5:{s:9:\"target_id\";s:2:\"33\";s:3:\"alt\";s:0:\"\";s:5:\"title\";s:0:\"\";s:5:\"width\";s:4:\"3872\";s:6:\"height\";s:4:\"2592\";}i:2;a:5:{s:9:\"target_id\";s:2:\"34\";s:3:\"alt\";s:0:\"\";s:5:\"title\";s:0:\"\";s:5:\"width\";s:4:\"3872\";s:6:\"height\";s:4:\"2592\";}i:3;a:5:{s:9:\"target_id\";s:2:\"35\";s:3:\"alt\";s:0:\"\";s:5:\"title\";s:0:\"\";s:5:\"width\";s:4:\"3872\";s:6:\"height\";s:4:\"2592\";}}}}',-1,1405027759.694,1,'entity_field_info:1',0,85),('field:taxonomy_term:1','a:0:{}',-1,1404676776.001,1,'entity_field_info:1',0,85),('field:taxonomy_term:2','a:0:{}',-1,1404676776.014,1,'entity_field_info:1',0,85),('field:taxonomy_term:3','a:0:{}',-1,1404676776.025,1,'entity_field_info:1',0,85),('field:user:0','a:0:{}',-1,1404677970.532,1,'entity_field_info:1',0,85),('field:user:1','a:0:{}',-1,1406187050.330,1,'entity_field_info:1',0,85),('field:user:5','a:0:{}',-1,1404677952.485,1,'entity_field_info:1',0,85),('field:user:6','a:0:{}',-1,1410993733.108,1,'entity_field_info:1',0,85),('field:user:7','a:0:{}',-1,1410993733.119,1,'entity_field_info:1',0,85),('field:user:8','a:0:{}',-1,1404678691.440,1,'entity_field_info:1',0,85);
