help\" role=\"complementary\">\n  \n    \n\n  <div class=\"content\">\n          <h2>Getting Started</h2><p>Follow these steps to set up and start using your website:</p><ol><li><strong>Configure your website</strong> Once logged in, visit the <a href=\"/admin\">Administration page</a>, where you may <a href=\"/admin/config\">customize and configure</a> all aspects of your website.</li><li><strong>Enable additional functionality</strong> Next, visit the <a href=\"/admin/modules\">Extend page</a> and enable modules that suit your specific needs. You can find additional modules at the <a href=\"https://drupal.org/project/modules\">Drupal.org modules page</a>.</li><li><strong>Customize your website design</strong> To change the \"look and feel\" of your website, visit the <a href=\"/admin/appearance\">Appearance page</a>. You may choose from one of the included themes or download additional themes from the <a href=\"https://drupal.org/project/themes\">Drupal.org themes page</a>.</li><li><strong>Start posting content</strong> Finally, you may <a href=\"/node/add\">add new content</a> to your website.</li></ol><p>For more information, refer to the subjects listed in the Help Topics section or to the <a href=\"https://drupal.org/documentation\">online documentation</a> and <a href=\"https://drupal.org/support\">support</a> pages at <a href=\"https://drupal.org\">drupal.org</a>.</p>\n\n      </div>\n</div>\n\";s:6:\"#cache\";a:1:{s:4:\"tags\";a:5:{s:7:\"content\";b:1;s:10:\"block_view\";b:1;s:5:\"block\";a:1:{s:11:\"bartik_help\";s:11:\"bartik_help\";}s:5:\"theme\";s:6:\"bartik\";s:12:\"block_plugin\";a:1:{s:17:\"system_help_block\";s:17:\"system_help_block\";}}}}',-1,1411875590.407,1,'content:1 block_view:1 block:bartik_help theme:bartik block_plugin:system_help_block',91,1),('entity_view:block:bartik_help:en:bartik:http://www.iangoegebuer.com/admin/modules','a:2:{s:7:\"#markup\";s:517:\"<div class=\"block block-system\" id=\"block-bartik-help\" role=\"complementary\">\n 