level.Â </p>\n\n<p>As well as working on campus, I also have been an active member and officer in many clubs on campus. I was webmaster and vice president of the Long Beach chapter of the Association of Computing Machinery. The project manager for the Embedded Applications Technology Assosiation. And I currently hold the position of Vice President of Technology the the Long Beach Makers Society.</p>\n\n<p>I\'m busy, very busy and really love what I do. My current projects are my Rep Rap Redux in which I am redesigning and building a new 3D printer using what I learning from my Prusa Mendel and other printers I have examined into a 1.5ft cubed printer. It will be HUGE.</p>\n</div>\n      </div>\n</div>\n\n  </div>\n\n      <footer class=\"link-wrapper\">\n      <drupal:render-cache-placeholder callback=\"\\Drupal\\node\\NodeViewBuilder::renderLinks\" token=\"LqAUwKN1o2rDe_3MjIsiS9Eh3xgZD--3xSJgw0HG6QbbdjqGOb4Sby9oGtAdQr1mzidVNgS7hA\" />\n    </footer>\n  \n</article>\";s:18:\"#post_render_cache\";a:1:{s:41:\"\\Drupal\\node\\NodeViewBuilder::renderLinks\";a:1:{i:0;a:5:{s:14:\"node_entity_id\";s:1:\"1\";s:9:\"view_mode\";s:4:\"full\";s:8:\"langcode\";s:2:\"en\";s:10:\"in_preview\";b:0;s:5:\"token\";s:74:\"LqAUwKN1o2rDe_3MjIsiS9Eh3xgZD--3xSJgw0HG6QbbdjqGOb4Sby9oGtAdQr1mzidVNgS7hA\";}}}s:6:\"#cache\";a:1:{s:4:\"tags\";a:4:{s:9:\"node_view\";b:1;s:4:\"node\";a:1:{i:1;s:1:\"1\";}s:4:\"user\";a:1:{i:1;s:1:\"1\";}s:13:\"filter_format\";a:1:{s:9:\"full_html\";s:9:\"full_html\";}}}}',-1,1407225073.185,1,'node_view:1 node:1 user:1 filter_format:full_html',85,2),('entity_view:node:1:full:bootstrap_business:r.authenticated,administrator','a:4:{s:7:\"#markup\";s:2170:\"<article id=\"node-1\" class=\"node node-page view-mode-full contextual-region clearfix\" role=\"article\" data-history-node-id=\"1\" data-quickedit-entity-id=\"node/1\" about=\"/about\" typeof=\"schema:WebPage\">\n\n  <header>\n    \n        <div data-contextual-id=\"node:node=1:changed=1405024914\"></div>  <span p