e Association of Computing Machinery. The project manager for the Embedded Applications Technology Assosiation. And I currently hold the position of Vice President of Technology the the Long Beach Makers Society.</p>\n\n<p>I\'m busy, very busy and really love what I do. My current projects are my Rep Rap Redux in which I am redesigning and building a new 3D printer using what I learning from my Prusa Mendel and other printers I have examined into a 1.5ft cubed printer. It will be HUGE.</p>\n</div>\n      </div>\n</div>\n<drupal:render-cache-placeholder callback=\"\\Drupal\\node\\NodeViewBuilder::renderLinks\" token=\"bu_sMc9h0FRJo_JFHDpPZVPKeCdhVj3t-OHYKaHmLdz8spaJkHbEHCGSnGMMqxHTIQ6ONa6IJw\" />\";s:18:\"#post_render_cache\";a:1:{s:41:\"\\Drupal\\node\\NodeViewBuilder::renderLinks\";a:1:{i:0;a:5:{s:14:\"node_entity_id\";s:1:\"1\";s:9:\"view_mode\";s:3:\"rss\";s:8:\"langcode\";s:2:\"en\";s:10:\"in_preview\";b:0;s:5:\"token\";s:74:\"bu_sMc9h0FRJo_JFHDpPZVPKeCdhVj3t-OHYKaHmLdz8spaJkHbEHCGSnGMMqxHTIQ6ONa6IJw\";}}}s:6:\"#cache\";a:1:{s:4:\"tags\";a:4:{s:9:\"node_view\";b:1;s:4:\"node\";a:1:{i:1;s:1:\"1\";}s:4:\"user\";a:1:{i:1;s:1:\"1\";}s:13:\"filter_format\";a:1:{s:9:\"full_html\";s:9:\"full_html\";}}}}',-1,1404761523.896,1,'node_view:1 node:1 user:1 filter_format:full_html',46,1),('entity_view:node:1:teaser:bootstrap_business:r.anonymous','a:3:{s:7:\"#markup\";s:1740:\"<article id=\"node-1\" class=\"node node-page promoted sticky view-mode-teaser contextual-region clearfix\" role=\"article\" data-history-node-id=\"1\" data-quickedit-entity-id=\"node/1\" about=\"/about\" typeof=\"schema:WebPage\">\n\n  <header>\n    \n          <h2>\n        <a href=\"/about\"><span class=\"field field-node--title field-name-title field-type-string field-label-hidden\" data-quickedit-field-id=\"node/1/title/en/teaser\">About Me</span>\n</a>\n      </h2>\n        <div data-contextual-id=\"node:node=1:changed=1404079019\"></div>  <span property=\"schema:name\" content=\"About Me\" class=