DROP TABLE IF EXISTS `node`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `node` (
  `nid` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'The node ID.',
  `vid` int(10) unsigned DEFAULT NULL COMMENT 'The node revision ID.',
  `type` varchar(32) NOT NULL COMMENT 'The node type.',
  `uuid` varchar(128) NOT NULL COMMENT 'The node UUID.',
  PRIMARY KEY (`nid`),
  UNIQUE KEY `node__uuid` (`uuid`),
  UNIQUE KEY `node__vid` (`vid`),
  KEY `node_field__type__target_id` (`type`)
