INSERT INTO `node_revision__body` VALUES ('page',0,1,1,'en',0,'<p>Hello! I&#39;m Ian. I&#39;ve pushed this site live a lot sooner than I expected because I&#39;m taking a trip and would like to share that with you!</p>\r\n\r\n<p>So a little about me, I&#39;m currently studying Computer Engineering at California State University, Long Beach<em>(CSULB)</em> with a minor in Computer Science. I work for the University Relations and Developement Department for my university and played a major role in one of the largest social media pushes the university has ever done. I am continuing to help innovate and bring CSULB to the next level.&nbsp;</p>\r\n\r\n<p>As well as working on campus, I also have been an active member and officer in many clubs on campus. I was webmaster and vice president of the Long Beach chapter of the Association of Computing Machinery. The project manager for the Embedded Applications Technology Assosiation. And I currently hold the position of Vice President of Technology the the Long Beach Makers Society.</p>\r\n\r\n<p>I&#39;m busy, very busy and really love what I do. My current projects are my Rep Rap Redux in which I am redesigning and building a new 3D printer using what I learning from my Prusa Mendel and other printers I have examined into a 1.5ft cubed printer. It will be HUGE.</p>\r\n','','full_html'),('gallery',0,9,9,'en',0,'<p>As would be normal to hear from Americans, but the age of the buildings and the architecture is wonderful! I can&#39;t put into words how wonderful it is to see the architecture. I put some pictures of what the old town looks like. You can find replicas in the states, but it really doesn&#39;t compare to the real life age and beauty. See for yourself!</p>\r\n','','full_html'),('gallery',0,10,10,'en',0,'<p>The people of Switzerland are almost as striking as the <a href=\"http://www.iangoegebuer.com/node/9\">architecture</a>! You see some people performing(very little in fact). Most people just keep to themselves and carry on. The last picture is Julian, he&#39;s been teaching us a touch of French. He is a vary animated individual and is a lot of fun to be around. He&#39;s Scottish and Swiss. He is extremely animated and really seems to enjoy what he does.</p>\r\n\r\n<p>So the interesting thing about the Swiss is they don&#39;t make eye contact. It&#39;s hard to get used to because doing so is really weird and makes the locals uncomfortable.&nbsp;</p>\r\n','','full_html'),('article',0,11,11,'en',0,'I\'m on my phone so this shall be quick, but I\'m laying in a Hotel Hostel in Milan Italy. This city is so full of life and the people are so animated! Being here is so much fun!\r\n\r\nI\'ll write more tomorrow when I get back to Switzerland. ','','basic_html'),('gallery',0,12,12,'en',0,'<p>The food an coffee here is amazing! The calzone in Italy was wonderful!</p>\r\n\r\n<p>Okay, so coffee or caf&eacute; as it&#39;s really called is good. It is not coffee as we know it. It is really smooth and really small. I like it, but I really do miss American Coffee. The coffee here is good for about 5 seconds and then it&#39;s been drunk. It is actually a really good desert or post desert drink.</p>\r\n\r\n<p>Desert brings me to chocolate. The chocolate here is amazing. They have 80% cocoa. So dark! So good! There&#39;s also one with carmel crunchy bits in it.&nbsp;</p>\r\n','','basic_html'),('gallery',0,13,13,'en',0,'<p> Geneva is the closest thing to a city as I think of them in Switzerland. It\'s very international and very much not Swiss. The people are in a rush. The city is beautiful,as is the gyser. The food is okay. At least where we tried. The main reason for Geneva was CERN. </p>','','basic_html');
/*!40000 ALTER TABLE `node_revision__body` ENABLE KEYS */;
UNLOCK TABLES;

