INSERT INTO `search_dataset` VALUES (1,'en','node_search',' about me about me hello i m ian i ve pushed this site live a lot sooner than i expected because i m taking a trip and would like to share that with you so a little about me i m currently studying computer engineering at california state university long beach  csulb  with a minor in computer science i work for the university relations and developement department for my university and played a major role in one of the largest social media pushes the university has ever done i am continuing to help innovate and bring csulb to the next level as well as working on campus i also have been an active member and officer in many clubs on campus i was webmaster and vice president of the long beach chapter of the association of computing machinery the project manager for the embedded applications technology assosiation and i currently hold the position of vice president of technology the the long beach makers society i m busy very busy and really love what i do my current projects are my rep rap redux in which i am redesigning and building a new 3d printer using what i learning from my prusa mendel and other printers i have examined into a 15ft cubed printer it will be huge  ',0),(9,'en','node_search',' architecture architecture as would be normal to hear from americans but the age of the buildings and the architecture is wonderful i can t put into words how wonderful it is to see the architecture i put some pictures of what the old town looks like you can find replicas in the states but it really doesn t compare to the real life age and beauty see for yourself  ',0),(10,'en','node_search',' people people the people of switzerland are almost as striking as the architecture  you see some people performing very little in fact most people just keep to themselves and carry on the last picture is julian he s been teaching us a touch of french he is a vary animated individual and is a lot of fun to be around he s scottish and swiss he is extremely animated and really seems to enjoy what he does so the interesting thing about the swiss is they don t make eye contact it s hard to get used to because doing so is really weird and makes the locals uncomfortable  ',0),(11,'en','node_search',' hello from milan italy hello from milan italy i m on my phone so this shall be quick but i m laying in a hotel hostel in milan italy this city is so full of life and the people are so animated being here is so much fun i ll write more tomorrow when i get back to switzerland  ',0),(12,'en','node_search',' food and coffee  food and coffee  the food an coffee here is amazing the calzone in italy was wonderful okay so coffee or cafÃ© as it s really called is good it is not coffee as we know it it is really smooth and really small i like it but i really do miss american coffee the coffee here is good for about 5 seconds and then it s been drunk it is actually a really good desert or post desert drink desert brings me to chocolate the chocolate here is amazing they have 80 cocoa so dark so good there s also one with carmel crunchy bits in it  ',0),(13,'en','node_search',' geneva geneva geneva is the closest thing to a city as i think of them in switzerland it s very international and very much not swiss the people are in a rush the city is beautiful as is the gyser the food is okay at least where we tried the main reason for geneva was cern  ',1407194495);
